import React,{ Component , Fragment } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow,MDBIcon , MDBListGroup , MDBBadge ,MDBListGroupItem } from "mdbreact";
class Coursrlist extends Component{
    render(){
        return(
        
            <Fragment>
               <MDBContainer>
               <MDBRow >
                   
                  </MDBRow>

                  <MDBListGroup style={{ width: "22erm" }}>
    <MDBListGroupItem className="d-flex justify-content-between align-items-center " >{this.props.details.name}
    <MDBBtn  color="danger" onClick={this.props.deletecourse(this.prop)}>Delete</MDBBtn>
    </MDBListGroupItem>
    </MDBListGroup>
                
                 

               </MDBContainer>
        
          </Fragment>

     
        )
    }
};
 export default Coursrlist;
